import { createAction } from 'typesafe-actions';
import * as eventTypes from './eventTypes';
export const newsRequestedEvent = createAction(eventTypes.CONTENT_NEWS_REQUESTED);
export const newsReceivedEvent = createAction(eventTypes.CONTENT_NEWS_RECEIVED, resolve => response => resolve(response));
export const newsErroredEvent = createAction(eventTypes.CONTENT_NEWS_ERRORED, resolve => response => resolve(response));
